//************************************************************
//* THIS JOB ALLOCATES CONTROL BLOCK LIBRARY. IT SHOULD BE   *
//* EXECUTED BEFORE ANYTHING.                                *
//************************************************************
//PRCBGEN JOB (CHERNYAK),'GEN CONTROL BLOCKS',MSGCLASS=X,
//       MSGLEVEL=(2,0)
//CREATE EXEC  PGM=IEFBR14
//LIB    DD    DSN=MVS.REASM.CTRL,DISP=(NEW,CATLG),
//       UNIT=SYSDA,SPACE=(CYL,(30,30,500)),
//       DCB=(BLKSIZE=13030,RECFM=U)
//*
//*
//*
//*
//************************************************************
//*  THIS HUGE JCL CREATES A NUMBER OF CONTROL BLOCKS        *
//*  DESCRIPTORS IN CONTROL LIBRARY.                         *
//*                                                          *
//************************************************************
